import React from 'react'
import {Jumbotron} from 'reactstrap'
import ListView from './listView.jsx'
import Rowview from './table'
class Head extends React.Component{
    state={
        todo:[
            {
                id:'1',
                isSelect:false,
                text:'sdgewrhetj',
                time:new Date(),
                
                isCompelete:false
            },
            {
                id:'2',
                isSelect:false,
                text:'sdgerytjcytdfugy',
                time:new Date(),
                
                isCompelete:false
            }
        ]
    }

    KeyPressHandeler=(event)=>{
        
        if(event.key==='Enter'){
            console.log('llll');
            let take=event.target.value;
            this.setState({todo:this.state.todo.concat({take})})
            
        }
    }
    p=this.state.todo.map(( to)=>(<div><Rowview todo={to}/></div>))
render(){
    return(
        
        <div>
        
        <Jumbotron>
            <h3 className='d-flex mx-auto'>React TO-DO</h3>
        </Jumbotron>
        <input type='text' onKeyPress={this.KeyPressHandeler}/>
        <ListView todo={this.state.todo[1]} toggleSelect={this.toggleSelect} toggleComplete={this.toggleComplete}/>
        <Rowview todo={this.state.todo[0]} toggleSelect={this.toggleSelect} toggleComplete={this.toggleComplete} />
        <p>{this.p}</p>
        </div>
    )
        
    }
}

export default Head;
